import React from "react";

import { Card } from "react-bootstrap";

export const Post = ({ post }) => {
  return (
    <Card>
      <Card.Title>
          <img src={post.author.photoUrl} style={{width : "30px" , height : "30px"}} className="border rounded-circle" />
      </Card.Title>
    </Card>
  );
};
